// src/components/MainPage.jsx
import React from 'react';
import './index.css'
const MainPage = () => {
  return (
    <div className="main-page">
      <h1>Welcome to CryptoCalc</h1>
      <p>The ultimate tool for polynomial arithmetic over Galois Fields</p>
      <div className="button-group">
        <a href="/register" className="button primary-button">Register</a>
        <a href="/login" className="button secondary-button">Log In</a>
      </div>
      <div className="features">
        <div className="feature-card">
          <h3>Fast Calculations</h3>
          <p>Perform complex polynomial arithmetic in milliseconds with optimized algorithms</p>
        </div>
        <div className="feature-card">
          <h3>Visual Interface</h3>
          <p>Intuitive visualization tools for understanding Galois Field operations</p>
        </div>
        <div className="feature-card">
          <h3>Secure Platform</h3>
          <p>Enterprise-grade security for all your cryptographic computations</p>
        </div>
      </div>
    </div>
  );
};

export default MainPage;
